import React, { useEffect } from "react";
import "./admin.css"
import axios from 'axios';





const Admin = () => {


    useEffect(()=>{
        axios.get("")
    })

    return(
        <>
        <div className="admin-outer">
            <div className="admin-inner">
                <div className="admin-inner-child">
                    <ul>
                        <li>inquires</li>
                        <li>book services</li>
                        <li>plan book</li>
                    </ul>
                </div>
                <div className="admin-inner-child">
                    <div className="inquires">

                    </div>
                </div>
            </div>
        </div>
        </>
    )
}



export default Admin;
